import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import UnPokemon from './Components/UnPokemon.js';

fetch('https://pokeapi.co/api/v2/pokemon/charizard/')
  .then((response) => {
    return response.json()
  })
  .then((result) => {
    console.log(result)
  })

class App extends Component {
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
